<p>Our ideal candidates have a proven ability to deliver testable, evolvable, and scalable React-based architectures. They are passionate about user experience and are driven to deliver value to users. They thrive on challenging problems, understand the nuances of performance and memory optimization, possess and can capably articulate strong opinions, and feel comfortable collaborating with a distributed team.</p>
